import React from "react";
import { NavLink } from "react-router-dom";
import { useSelector } from "react-redux";
const Cart = () => {
    const cart_leng = useSelector((state)=>state.length)
  return (
    <>
      <NavLink to="/cartBtn" className="btn btn-outline-primary">
        <span className="fa fa-shopping-cart me-1 "><span className="badge badge-dark fw-bold bg-secondary">{cart_leng}</span>  </span>
      </NavLink>
    </>
  );
};

export default Cart;
